        <div>
          <img src="images/Rectangle.png" width={1000} />
        </div>
        <DoctorSelectUser />
        {/*  <DoctorServices /> */}
        {/* <DoctorTraining /> */}
        {/* <DoctorTodayAppointment /> */}
      </div>
    </DoctorMenu>
  );
};

export default DoctorSelectUserType;
